scriptlet.script:
var fields = JSON.parse(scriptletInput).fields;
var programs = [];
fields.forEach(function(j) {
	if (j.name == 'program') {
		programs.push(j.value);
	}
});

scriptletResult = programs[0];

var fields = JSON.parse(scriptletInput).fields;
var programs = [];
fields.forEach(function(j) {
	if (j.name == 'program') {
		programs.push(j.value);
	}
});

scriptletResult = programs[0];

var pr = scriptletContext.get("RS_Previous_Response");
var labID = scriptletContext.get("labID");
switch(pr) {
	case "more items":
		if(output.trim().length > 0) {
			if(labID != undefined) {
				labID = labID.concat(",",output);
				scriptletResponse = "failure";
				scriptletContext.put("FailureMessage","Multiple Lab Ids returned. It should be only one");
			}
			else {
				labID = output;
			}
			scriptletContext.put("labID",labID);
		}
		scriptletResponse = "more";
	break;

	case "no more items":
		if(labID != undefined) {
			scriptletResponse = "complete";
		}
		else {
			scriptletResponse = "failure";
			scriptletContext.put("FailureMessage","No Lab Id returned");
		}
	break;

	case udefined:
		scriptletResponse = "failure";
		scriptletContext.put("FailureMessage","Datatabse Error:" + output);
	break;
}

try {
	var flds = JSON.parse(document).fields;
	var re = /^o[1-9]_programName$/;
	//df18e2a2_0d10_ca0f_6c98_d98d60f637e3 - CDF Enablement
	//
	var items = flds.filter(function(i) {		
		return i.displayName == "CDF Enablement" || i.displayName == "CMT";
	});

	if(items.length > 0) {
		scriptletContext.put("programName",items[0].displayName);
	}
	else {
		throw new Error("Failure, program name not found in the request");
	}

	items = flds.filter(function(i) {		
		return i.name == "productSuite" || i.name == "regionName";
	});

	if(items.length > 0) {
		scriptletContext.put(items[0].name,items[0].value);
	}
	else {
		throw new Error("Failure, neither productSuite nor regionName was found in the request");
	}

	items = flds.filter(function(i) {
		return i.name == "customerName";
	});

	if(items.length > 0) {
		scriptletContext.put("customerName",items[0].value);
	}


	scriptletResponse = "success";
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	scriptletResponse = "failure";	
}

try {
	if(programName.trim() != "") {
		var sql;
		if(productSuite.trim() != "") {
			sql = "select ID from ENA_LABS where PROGRAM = '" + programName + "' and SUITE = '" + productSuite + "'"; 
		}
		else if (regionName.trim() != "") {
			sql = "select ID from ENA_LABS where PROGRAM = '" + programName + "' and REGION = '" + regionName + "'";
		}
		else {
			throw new Error("Failure, both option properties: productSuite and regionName are empty");
		}
		scriptletResult = sql;
		scriptletContext.put("SQL",sql);
		scriptletResponse = "success";
	}
	else {
		throw new Error("Failure, option property programName is empty");
	}
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}
